          <div className="contact1">
          <div className='row-box'>
          <div className='iconEdit'><LocationOnIcon /></div>
          <div> &nbsp; &nbsp; SURAT INDIA</div>
        
          </div>
          <div className='row-box'>
          <div className='iconEdit'><EmailIcon /></div>
          <div> &nbsp; &nbsp; dhruv9619@gmail.com</div></div>

           <div className='row-box'>
          <div className='iconEdit'><CodeIcon /></div>
          <div> &nbsp; &nbsp; Codeforces: dhruv9619</div></div>
             
          </div> 
          <div className="contact2">
          <form ref={form} onSubmit={sendEmail}>
           <div className='inputField'>
          <div >
              <input className='nameEdit' type="text" placeholder='NAME'></input>
          </div>
        </div>

        <div className='inputField'>
          <div >
              <input className='nameEdit' type="email" placeholder='EMAIL'></input>
          </div>
        </div>

        <div className='inputField'>
          <div >
              <textarea className='areaEdit' type="text" placeholder='MESSEGE'></textarea>
          </div>
        </div>
        
        <div className='inputField'>
          <div >
              <button>SUBMIT</button>
          </div>
          
        </div>
        </form>
          
                
          </div>

          </div>
      
       
         
           
        </div>
  )
}

export default Contact;
